}

.colors__rectangle-26-text {
  /* Green #6FCF97 */
  @include text($width: 86px, $height: 56px, $left: 260px, $top: 692px);
}

.types__h1 {
  @include text($width: 29px, $height: 30px, $left: 854px, $top: 145px);
