  font-size: 19px;
  line-height: 23px;
  /* identical to box height */
  text-align: right;

  /* Dark 25% */
  color: rgba(31, 32, 65, 0.25);
}

.types__title-inside-widget {
  @include text($width: 312px, $height: 47px, $left: 913px, $top: 255px);
  font-size: 19px;
  line-height: 23px;
}

.types__h3 {
  @include text($width: 17px, $height: 15px, $left: 866px, $top: 355px);
  font-weight: 400;
  font-size: 12px;
  line-height: 15px;
  /* identical to box height */
  text-align: right;
  text-transform: uppercase;

  /* Dark 25% */
  color: rgba(31, 32, 65, 0.25);
}

.types__label {
  @include text($width: 186px, $height: 15px, $left: 913px, $top: 353px);
  font-size: 12px;
  line-height: 15px;
  /* identical to box height */
  text-transform: uppercase;
}

.types__body {
