sources.../ui-kit/colors-and-type/scss/mixins.sc:
@mixin rectangle($left, $top, $background) {
  position: absolute;
  width: 70px;
  height: 70px;
  left: $left;
  top: $top;

  background: $background;
  border-radius: 6px;
}

@mixin text($width, $height, $left, $top) {
  /* Dark Shade 100% #1F2041 */
  position: absolute;
  width: $width;
  height: $height;
  left: $left;
  top: $top;

  font-family: 'Montserrat';
  font-style: normal;
  font-weight: 700;
  font-size: 19px;
  line-height: 28px;
  display: flex;
  align-items: center;

  /* Dark 100% */

  color: #1F2041;
}
